class LFUCache {

  Map<Integer, Node>   map;
  Map<Integer, Node[]> ht;

  Node head = null;

  int cap      = 0;
  int capacity = 0;

  public LFUCache(int capacity) {
    map = new HashMap<>(capacity);
    ht = new HashMap<>();
    this.capacity = capacity;
  }

  public void addToTail(int i, Node target) {
    if (i == 1 && !ht.containsKey(1)) {
      ht.put(1, new Node[] { target, target });
      target.next = head;
      head.prev = target;
      head = target;
      return;
    }
    Node t = ht.get(i)[1];
    Node tnext = t.next;
    t.next = target;
    target.prev = t;
    if (tnext != null) {
      tnext.prev = target;
      target.next = tnext;
    }
    ht.get(i)[1] = target;
  }

  public void unlinkNode(Node node) {
    Node pre = node.prev;
    Node nxt = node.next;
    if (pre == null && nxt == null) {
      return;
    } else {
      if (pre != null) {
        pre.next = node.next;
      }
      if (nxt != null) {
        nxt.prev = node.prev;
      }
      node.prev = null;
      node.next = null;
    }
  }

  public int get(int key) {
//    if (head != null && head.next == null) {
//      System.out.print("");
//    }
    if (map.containsKey(key)) {
      Node target = map.get(key);
      target.use();
      Node[] cur = ht.get(target.lfu());
      Node[] pre = ht.get(target.lfu() - 1);
      if (target == head && target.next != null) {
        head = target.next;
      }

      Node catchUp = null;

      if (pre[0] == pre[1]) {
        catchUp = pre[0].prev;
        ht.remove(target.lfu() - 1);
      } else {
        if (pre[0] == target) {
          ht.get(target.lfu() - 1)[0] = target.next;
        } else if (pre[1] == target) {
          ht.get(target.lfu() - 1)[1] = target.prev;
        }
        catchUp = ht.get(target.lfu() - 1)[1];
      }
      unlinkNode(target);

      if (cur == null) {
        ht.put(target.lfu(), new Node[] { target, target });
        if (catchUp != null) {
          Node tmp = catchUp.next;
          catchUp.next = target;
          target.prev = catchUp;
          if (tmp != null) {
            tmp.prev = target;
            target.next = tmp;
          }
        } else {
          target.next = head;
          head.prev = target;
          head = target;
        }
      } else if (cur != null) {
        addToTail(target.lfu(), target);
      }

      return target.getValue();
    } else {
      return -1;
    }
  }

  public void put(int key, int value) {
//    if (head != null && head.next == null) {
//      System.out.print("");
//    }
    if (capacity == 0) {
      return;
    }
    if (map.containsKey(key)) {
      map.get(key).setValue(value);
      get(key);
      return;
    }
    Node node = new Node(key, value);
    if (cap == 0) {
      head = node;
      ht.put(1, new Node[] { node, node });
    } else {
      addToTail(1, node);
      if (cap == capacity) {
        Node h = ht.get(1)[0];
        if (node != h) {
          Node n = h.next;
          head = n;
          h.next = null;
          n.prev = null;
          ht.get(1)[0] = n;
          if (h.getKey() == 638) {
            System.out.print("1");
          }
          map.remove(h.getKey());
          cap--;
        } else {
          Node toDel = h.next;

          Node hh = ht.get(toDel.lfu())[0];
          Node tt = ht.get(toDel.lfu())[1];
          if (hh == tt) {
            ht.remove(toDel.lfu());
          } else {
            ht.get(toDel.lfu())[0] = hh.next;
          }

          unlinkNode(toDel);
          if (h.getKey() == 638) {
            System.out.print("2");
          }
          map.remove(toDel.getKey());
          cap--;
        }
      }
    }
    map.put(key, node);
    cap++;
  }

  static class Node implements Map.Entry<Integer, Integer> {
    final int key;
    int       value;
    Node      next;
    Node      prev;
    int       lfu = 1;

    Node(int key, int value) {
      this.key = key;
      this.value = value;
    }

    Node(int hash, int key, int value, Node next) {
      this.key = key;
      this.value = value;
      this.next = next;
    }

    public int lfu() {
      return lfu;
    }

    public int use() {
      return ++lfu;
    }

    public final Integer getKey() {
      return key;
    }

    public final Integer getValue() {
      return value;
    }

    public final Integer setValue(Integer newValue) {
      int oldValue = value;
      value = newValue;
      return oldValue;
    }

    public final boolean equals(Object o) {
      if (o == this)
        return true;
      if (o instanceof Map.Entry) {
        Map.Entry<?, ?> e = (Map.Entry<?, ?>) o;
        if (Objects.equals(key, e.getKey())
            &&
            Objects.equals(value, e.getValue()))
          return true;
      }
      return false;
    }

  }
}

